import Meals from "./Meals";
import classes from "./AvailableMeals.module.css";

const AvailableMeals = () => {
  const DUMMY_MEALS = [
    {
      id: "m1",
      name: "Aalu Puri",
      description: "Finest fish and veggies",
      img: "img/aloo_puri.jpg",
      price: 60,
    },
    {
      id: "m2",
      name: "Steam Momos",
      description: "A Chinese specialty!",
      img: "img/1200px-Momo_nepal",
      price: 50,
    },
    {
      id: "m3",
      name: "Chicken Burger",
      description: "American, raw, meaty",
      img: "img/Moist-Chicken-Burgers",
      price: 90,
    },
    {
      id: "m4",
      name: "Mutton Briyani",
      img: "img/Best-Mutton-Biryani-Recipe",
      description: "Famous Hyderabadi Briyani ",
      price: 250,
    },
  ];
  return (
    <div className={classes.availableMeal}>
      {DUMMY_MEALS.map((item) => (
        <Meals key={item.id} {...item}></Meals>
      ))}
    </div>
  );
};

export default AvailableMeals;
